import './App.css';
import React from 'react'
function App() {
  const phrases = ['web app development','mobile app development','UI/UX design']
  const [displayPhrase,setDisplayPhrase] = React.useState(0)
  for(var i=0;i<phrases.length;i++){
    var sel = phrases[i]
    for(var j=0;j<sel;j++){
       setDisplayPhrase([sel[i]])
    }
  }
  return (
    <div style={container}>
      <div style={quote}>I'm Gokul , good in </div>
      <div style={cursor}></div>
    </div>
  );
}

const cursor = {
  height:'25px',
  width:'4px',
  backgroundColor:'green',
}


const container = {
  position:'absolute',
}

const quote={
  position:'relative'
}

export default App;
